import React from 'react';
import { Carousel } from 'antd';
import './carousel.css'

const Car = ({ images }) => (
  <Carousel
    style={{ height: "700px", overflow: "hidden" }}
    autoplay
    autoplaySpeed={2000}
    arrows
    infinite
    className='carousel'
    slidesToShow={1.65}
    slidesToScroll={1}
  >
    {images.map((image, index) => (
      <div key={index}>
        <img src={image} alt={`Slide ${index}`} />
      </div>
    ))}
  </Carousel>
);

export default Car;
